INSERT INTO `helpdesk` VALUES (1,2,'How to check my historical orders?','<p>\r\n	Contents.\r\n</p>\r\n<p>\r\n	Contents.\r\n</p>\r\n<p>\r\n	Contents.\r\n</p>\r\n<p>\r\n	Contents.\r\n</p>',1,'2013-02-20 11:02:26'),(2,1,'B2B System Documentation','<p>\r\n	B2B System Documentation details.\r\n</p>\r\n<p>\r\n	B2B System Documentation details.\r\n</p>\r\n<p>\r\n	B2B System Documentation details.\r\n</p>\r\n<p>\r\n	B2B System Documentation details.\r\n</p>',1,'2013-02-20 11:11:57'),(3,3,'Contact Us','<p>\r\n	<strong><u>Business Support:</u></strong>\r\n</p>\r\n<p>\r\n	Tel: +61 12345678\r\n</p>\r\n<p>\r\n	Email: b2b_business_support@crazysales.com.au\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<strong><u>Technical Support:</u></strong>\r\n</p>\r\n<p>\r\n	Tel: +61 12345678\r\n</p>\r\n<p>\r\n	Email: b2b_technical_support@crazysales.com.au\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<img src=\"/scripts/kindeditor/attached/image/20130221/20130221102611_92869.gif\" alt=\"\" />\r\n</p>',1,'2013-02-20 11:39:04'),(4,1,'API Integration Documentation','<p>\r\n	API Integration Documentation details.\r\n</p>\r\n<p>\r\n	API Integration Documentation details.\r\n</p>\r\n<p>\r\n	API Integration Documentation details.\r\n</p>\r\n<p>\r\n	API Integration Documentation details.<br />\r\n</p>',1,'2013-02-21 02:48:03'),(5,2,'How to recharge my account?','<p>\r\n	Contents.\r\n</p>\r\n<p>\r\n	Contents.\r\n</p>\r\n<p>\r\n	Contents.\r\n</p>\r\n<p>\r\n	Contents.\r\n</p>',1,'2013-02-21 02:49:11'),(6,2,'How to place order?','<p>\r\n	Contents.\r\n</p>\r\n<p>\r\n	Contents.\r\n</p>\r\n<p>\r\n	Contents.\r\n</p>\r\n<p>\r\n	Contents.\r\n</p>',1,'2013-02-21 02:49:27'),(7,4,'Feed Generation Document','<p>\r\n	<strong>URL</strong>: This is the canonical URL for the feed address, please copy it to the merchant after generating the feed.\r\n</p>\r\n<p>\r\n	<strong>Feed Name</strong>: This string will be used in the URL directly, please keep it unique in system.\r\n</p>\r\n<p>\r\n	<strong>Extension</strong>: System supports CSV, TXT and XML format for the feed, the following options \"Delimiter\" &amp; \"Qualifier\" will be ignored if you choose the XML format.\r\n</p>\r\n<p>\r\n	<strong>Delimiter</strong>: You can choose Tab / Semicolon / Comma / Space or even a customize string as the delimiter.\r\n</p>\r\n<p>\r\n	<strong>Qualifier</strong>: System supports \" / \' or None as the qualifier.\r\n</p>\r\n<p>\r\n	<strong>Column Definition</strong>: This is the zone you can define the column for the specified feed.\r\n</p>\r\n<ul>\r\n	<li>\r\n		1st column: You can check or uncheck the fields in the feed by the check box.<br />\r\n	</li>\r\n	<li>\r\n		2nd column: Where you can define the titles for the feed, please note if you choose the XML format feed, the space will be removed from the words, for example \"<em>Factory URL</em>\" will be formatted to \"<em>FactoryURL</em>\" in XML feed.\r\n	</li>\r\n	<li>\r\n		3rd column: Column value, the parameter will be replaced to the actual value in the feed, please note that the specified format for the parameters can NOT be changed, but you can add any characters before or after the parameter, for instance you can update \"<em>&lt;{brand}&gt;</em>\" to \"<em>&lt;{brand}&gt; from Crazy Sales</em>\" if you wish.\r\n	</li>\r\n	<li>\r\n		4th column: Value Adjustment. You can have a top priority to decide the contents in the feed, for example you can update the stock 0 to \"<em>Out of Stock</em>\" in the feed by inputting this formula <em>[0|Out of Stock]</em>. You can add as much as the formulas as you like, for example if you\'d like to show \"<em>Out of Stock</em>\" for the zero stock items and \"<em>In Stock</em>\" for all the others, just input <em>[0|Out of Stock][&gt;1|In Stock]</em>\r\n	</li>\r\n	<li>\r\n		Sequence: The sequence of the columns in the feeds are sortable, just drag the rows on the arrow.\r\n	</li>\r\n</ul>\r\n<p>\r\n	<strong>Category</strong>: You can choose the products by specified categories.\r\n</p>\r\n<p>\r\n	<strong>SKUs included</strong>: The SKU you input will be displayed in the feed, please note the priority of this option is higher than the category, all the other SKUs will be removed from the feed except the ones you input here, therefore please keep this box empty normally, please use the comma as the delimiter.\r\n</p>\r\n<p>\r\n	<strong>SKUs excluded</strong>: You Can exclude the SKU you don\'t want to show in the feed, please use the comma as the delimiter.\r\n</p>\r\n<p>\r\n	<strong>Stock</strong>: You can choose the products either in or out of the stock from the database, if there are no condition on this, please select \"<em>All</em>\".\r\n</p>\r\n<p>\r\n	<strong>Discount Protection</strong>: To protect merchant\'s rights, we can set the product as out of stock if the offer prices are lower than merchant\'s expectation. <em>(For the details of the algorithm, please contact IT. )</em>\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	IT Department\r\n</p>\r\n<p>\r\n	March 7th, 2013\r\n</p>',1,'2013-03-07 06:25:19');
